import {mapActions, mapGetters} from "vuex"
export default {
  data () {
    return {
      skills: []
    }
  },
  computed: {
    ...mapGetters([
      'banners'
    ])
  }, 
  created() {
    this.getSkills()
  },
  methods: {
    async getSkills() {
      const res = await this.$post('/api/v2/ad', {type: '技能'})
      this.skills = res.data
    },
  }
}
